import React from "react";
import { SAVE_NEW_WELL_TO_REDUX_STORE_REQUESTED,
  SAVE_NEW_WELL_TO_REDUX_STORE_RECEIVED,
  SAVE_NEW_WELL_TO_REDUX_STORE_FAILED } from './types'

const saveNewWellToReduxStore = (well) => {
  return async dispatch => {
    dispatch({
      type: SAVE_NEW_WELL_TO_REDUX_STORE_REQUESTED,
    });

    try {
      console.log(well)
      dispatch({
        type: SAVE_NEW_WELL_TO_REDUX_STORE_RECEIVED,
        payload: well
      })
    } catch (error) {
      console.log(error)
      dispatch({
        type: SAVE_NEW_WELL_TO_REDUX_STORE_FAILED,
        payload: error
      })
    }
  }
}
export default saveNewWellToReduxStore
